    true,nt"url": null,nt"notes": "The National Household Education Survey,
    2005 After-School Programs and Activities (ASPA-NHES:2005), is a study that is part
    of the National Household Education Survey (NHES) program. ASPA-NHES:2005 (http://nces.ed.gov/nhes/)
    is a cross-sectional survey that collects data directly from households on educational
    issues. This study was conducted using address based sample, self-administered questionnaires
    of households. Households in 2005 were sampled. The studyufffds response rate was
    67.5 percent. Key statistics produced from ASPA-NHES:2005 are participation in after-school
    programs and activities.",nt"license_title": "Creative Commons CCZero",nt"extras":
